import React,{useState} from 'react'
import PropTypes from 'prop-types'




export default function Navbar(props) {
  const [switcTextColor, setswitcTextColor] = useState(
    {backgroundColor : ""}
  )
  const handleColor = ()=> {
    if(switcTextColor === "light"){
      setswitcTextColor(
        {color : "black"}
      )
    }
    else{
      setswitcTextColor(
        {color:"white"}
      )
      }
    }
  
  return (

 <nav className={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`} >
  <div className="container-fluid">
    <a className="navbar-brand" href="/">{props.Title}</a>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          <a className="nav-link active" aria-current="page" href="/">Home</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="/">{props.aboutText}</a>
        </li>
      </ul>
      {/* <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-primary" type="submit">Search</button>
      </form> */}
      <div className="form-check form-switch mx-3 " >
        <input className="form-check-input" onClick={props.switchToMode}   type="checkbox" role="switch" id="flexSwitchCheckDefault"/>
        {/* <div>Switch Mode</div> */}
        <label className="form-check-label "onChange={handleColor} htmlFor="flexSwitchCheckDefault">Switch Modes</label>
      </div>
    </div>
  </div>
 </nav>
  )
}

Navbar.propstypes= {
                    Title : PropTypes.string.isRequired,
                    aboutText : PropTypes.string.isRequired
                    
};
